import React from 'react';

function Footer(props) {
  const { paletteName, emoji } = props;
  return (
    <footer className='Palette__Footer'>
        {paletteName}
        <span className='Palette__Emoji'>
          {emoji}
        </span>
    </footer>
    );
  }

export default Footer;
